import React, { useState } from "react";
import { BrowserRouter as Router, Routes, Route, Link } from "react-router-dom";
import './App.css';
import Ratings from './ratingstable';
import LoginUser from './loginuser';
import DeleteRating from './deleterating';
import CreateUser from './createuser';
import AddNewRating from './addnewrating';
import UpdateRating from './updaterating';
import ViewRating from './viewrating';

function App() {
    return (
      <Router>
        <div>
          <ul>
            <li>
              <Link to="/ratingstable">Home</Link>
            </li>
            <li>
              <Link to="/deleterating">Delete Rating</Link>
            </li>
            <li>
              <Link to="/addnewrating">Add New Rating</Link>
            </li>
          </ul>

          <hr />

          <Routes>
            <Route exact path="/">
              <Home />
            </Route>
            <Route path="/deleterating">
              <About />
            </Route>
            <Route path="/addnewrating">
              <Dashboard />
            </Route>
          </Routes>
        </div>
      </Router>
    );
  }

  // You can think of these functional components as "pages" in your app.

  function Home() {
    return (
      <div>
        <h2>Home</h2>
      </div>
    );
  }

  function About() {
    return (
      <div>
        <h2>About</h2>
      </div>
    );
  }

  function Dashboard() {
    return (
      <div>
        <h2>Dashboard</h2>
      </div>
    );
  }



